import React from "react";

const Navigation = ({ onRouteChange, isSignedIn }) => {
  if (isSignedIn) {
    return (
      <nav style={{ display: "flex", justifyContent: "flex-end" }}>
      <p onClick={()=>onRouteChange('notes')} className='f3 link dim white underline pa3 pointer'>To-Do-List</p>
      <a href="https://realtime-chat-application.netlify.app/" className='f3 link dim white underline pa0 pointer'>Messanger</a>
        <p
          className='f3 link dim white underline pa3 pointer'
          onClick={() => onRouteChange("signout")}
        >
          Sign Out
        </p>
      </nav>
    );
  } else {
    return (
      <nav style={{ display: "flex", justifyContent: "flex-end" }}>
        <p
          className='f3 link dim white underline pa3 pointer'
          onClick={() => onRouteChange("signin")}
        >
          Sign In
        </p>
        <p
          className='f3 link dim white underline pa3 pointer'
          onClick={() => onRouteChange("register")}
        >
          Register
        </p>
      </nav>
    );
  }
};
export default Navigation;
